ElementDescription:
DSM-IV Criteria - Recurrent unexpected attacks with at least one attack consisting of 4 of the associated symptoms;
At least one attack has been followed by one month (or more) of: persistent worry about having another attack; worry about the implications of the attack or its consequences (eg, losing control, having a heart attack); or a significant change in behavior change in behavior related to the attacks
At least some attacks developed suddenly and increased in intensity within ten minutes;
Panic attacks not due to organic or pharmacological etiology; and
Panic attacks are not better accounted for by another mental disorder (eg, PTSD, social phobia, separation anxiety disorder) Summary CE
